					The BigBlueButton API calls are almost all made server-to-server. If you installed the package bbb-demo on your BigBlueButton server, you get a set of API examples, written in Java Server Pages (JSP), that demonstrate how to use the BigBlueButton API. These demos run as a web application in tomcat7. The web application makes HTTPS requests to the BigBlueButton server’s API end point.

					You can retrieve your BigBlueButton API parameters (API endpoint and shared secret) using the command

					$ bbb-conf --secret'=>'बिगब्लूबटन एपीआई सुरक्षा मॉडल तृतीय-पक्ष एप्लिकेशन को एपीआई कॉल करने में सक्षम बनाता है (यदि उनके पास साझा रहस्य है), लेकिन अन्य लोगों (अंतिम उपयोगकर्ताओं) को एपीआई कॉल करने की अनुमति नहीं देता है। BigBlueButton API कॉल लगभग सभी सर्वर-टू-सर्वर होती हैं। यदि आपने अपने बिगब्लूबटन सर्वर पर पैकेज बीबीबी-डेमो स्थापित किया है, तो आपको जावा सर्वर पेज (जेएसपी) में लिखे गए एपीआई उदाहरणों का एक सेट मिलता है, जो दर्शाता है कि बिगब्लूबटन एपीआई का उपयोग कैसे करें। ये डेमो tomcat7 में एक वेब एप्लिकेशन के रूप में चलते हैं। वेब एप्लिकेशन BigBlueButton सर्वर के API अंतिम बिंदु पर HTTPS अनुरोध करता है। आप कमांड $ bbb-conf --secret का उपयोग करके अपने BigBlueButton API पैरामीटर (API एंडपॉइंट और साझा रहस्य) को पुनः प्राप्त कर सकते हैं','The School Management'=>'स्कूल प्रबंधन','The School Management is a WordPress plugin to manage multiple schools and their entities such as classes, sections, students, exams, ID cards, admit cards, teachers, staff, fees, invoices, income, expense, noticeboard, study materials and much more.'=>'स्कूल प्रबंधन कई स्कूलों और उनकी संस्थाओं जैसे कक्षाओं, अनुभागों, छात्रों, परीक्षाओं, आईडी कार्ड, प्रवेश पत्र, शिक्षकों, कर्मचारियों, फीस, चालान, आय, व्यय, नोटिसबोर्ड, अध्ययन सामग्री और बहुत कुछ को प्रबंधित करने के लिए एक वर्डप्रेस प्लगइन है।','The transaction has been failed for reason: %s'=>'लेन-देन इस कारण से विफल हो गया है: %s','The user already has a staff record.'=>'उपयोगकर्ता के पास पहले से ही एक स्टाफ रिकॉर्ड है.','The user already has a student record.'=>'उपयोगकर्ता के पास पहले से ही एक छात्र रिकॉर्ड है।','The user has a parent record.'=>'उपयोगकर्ता के पास मूल रिकॉर्ड है.','Theory'=>'लिखित','There is no active staff.'=>'कोई सक्रिय स्टाफ नहीं है.','There is no books issued.'=>'कोई पुस्तकें जारी नहीं की गई हैं.','There is no certificate.'=>'कोई प्रमाणपत्र नहीं है.','There is no event.'=>'कोई आयोजन नहीं है.','There is no fee invoice.'=>'कोई शुल्क चालान नहीं है.','There is no homework.'=>'कोई होमवर्क नहीं है.','There is no live clas