 छात्र के परीक्षा परिणाम हटा दिए जाएंगे.','This will delete participant from the event.'=>'इससे प्रतिभागी को इवेंट से हटा दिया जाएगा.','This will delete student record for the session %s.'=>'यह सत्र %s के लिए छात्र रिकॉर्ड हटा देगा।','This will delete the %s.'=>'यह %s को हटा देगा.','This will delete the academic report. All associated data with this academic report will be lost.'=>'इससे शैक्षणिक रिपोर्ट हटा दी जाएगी. इस शैक्षणिक रिपोर्ट से संबंधित सभी डेटा नष्ट हो जाएंगे।','This will delete the book.'=>'इससे किताब हट जाएगी.','This will delete the certificate.'=>'इससे प्रमाणपत्र हट जाएगा.','This will delete the chapter.'=>'इससे अध्याय हट जाएगा.','This will delete the event.'=>'इससे ईवेंट हटा दिया जाएगा.','This will delete the exam group. All associated data with this exam will be lost.'=>'इससे परीक्षा समूह हट जाएगा. इस परीक्षा से संबंधित सभी डेटा नष्ट हो जाएंगे.','This will delete the exam. All associated data with this exam will be lost.'=>'इससे परीक्षा हटा दी जाएगी. इस परीक्षा से संबंधित सभी डेटा नष्ट हो जाएंगे.','This will delete the expense category.'=>'इससे व्यय श्रेणी हट जाएगी.','This will delete the expense.'=>'इससे खर्चा खत्म हो जाएगा.','This will delete the fee type.'=>'इससे शुल्क प्रकार हट जाएगा.','This will delete the homework.'=>'इससे होमवर्क डिलीट हो जाएगा.','This will delete the hostel.'=>'इससे छात्रावास हटा दिया जाएगा.','This will delete the income category.'=>'इससे आय श्रेणी हट जाएगी.','This will delete the income.'=>'इससे आय नष्ट हो जायेगी।','This will delete the inquiry.'=>'इससे पूछताछ हटा दी जाएगी.','This will delete the invoice along with payment detail if invoice is paid'=>'यदि चालान का भुगतान किया जाता है तो यह भुगतान विवरण के साथ चालान को भी हटा देगा','This will delete the lecture.'=>'इससे व्याख्यान हटा दिया जाएगा.','This will delete the library card.'=>'इससे लाइब्रेरी कार्ड हट जाएगा.','This will delete the live class.'=>'इससे लाइव क्लास डिलीट हो जाएगी.','This will delete the notice.'=>'इससे नोटिस हट जाएगा.','This will delete the payment from invoice.'=>'इससे चालान से भुगतान हट जाएगा.','This will delete the payment.'=>'इससे भुगतान हट जाएगा.','This will delete the record.'=>'इससे रिकॉर्ड डिलीट हो जाएगा.','This will delete the role.'=>'इससे भूमिका हट जाएगी.','This will delete the room.'=>'इससे कमरा हटा दिया जाएगा.','This will delete the routine.'=>'इससे रूटीन हट जाएगा.','This will delete the staff leave.'=>'इससे स्टाफ की छुट्टियां डिलीट हो जाएंगी.','This will delete the student activity.'=>'इससे छात्र गतिविधि हटा दी जाएगी.','This will delete the student certificate.'=>'इससे छात्र प्रमाणपत्र हटा दिया जाएगा.','This will delete the student leave.'=>'इससे छात्र की छुट्टी हट जाएगी.','This will delete the study material.'=>'इससे अध्ययन सामग्री नष्ट हो जायेगी।','This will delete the subject.'=>'इससे विषय हट जाएगा.','This will delete the timetable.'=>'इससे समय सारिणी हट जाएगी.','This will delete the transport route.'=>'इससे परिवहन मार्ग हट जाएगा.','This will delete the vehicle.'=>'इससे वाहन डिलीट हो जाएगा.','This will delete this admit card.'=>'इससे यह एडमिट कार्ड डिलीट हो जाएगा.','This will delete transferred student record for the session %s.'=>'यह सत्र %s के लिए स्थानांतरित छात्र रिकॉर्ड हटा देगा।','This will login the student after registration.'=>'इससे रजिस्ट्रेशन के बाद छात्र लॉग इन हो जाएगा।','This will remove medium from the class. All student records in this medium of all sessions will be moved to the default medium.'=>'इससे मीडियम को क्लास से हटा दिया जाएगा. इस माध्यम में सभी सत्रों के सभी छात्र रिकॉर्ड को डिफ़ॉल्ट माध्यम में ले जाया जाएगा।','This will remove section from the class. All student records in this section of all sessions will be moved to the default section.'=>'इससे अनुभाग कक्षा से हट जाएगा. इस अनुभाग के सभी सत्रों के सभी छात्र रिकॉर्ड को डिफ़ॉल्ट अनुभाग में ले जाया जाएगा।','This will remove student type from the class. All student records in this student type of all sessions will be moved to the default student type.'=>'इससे कक्षा से छात्र प्रकार हट जाएगा. इस छात्र प्रकार के सभी सत्रों के सभ